import AuthUser from './AuthUser';

export default function Dashboard() {
    const {user} = AuthUser();

    return(
        <div>
            <h4>Nombre</h4>
            <p>{user.name}</p>
            <h4>Email</h4>
            <p>{user.email}</p>
        </div>
    )
}
